import { useState,useEffect } from 'react'
import {fetchServer} from '../api_s/fetchServer'
import Item from './Item'

function AssetsList(props){
    const {collection}=props
    const [assets,setAssets]=useState(null)
    const [lastUpdate,setLastUpdate]=useState(null)
    useEffect(()=>{
        fetchServer(collection).then(el=>{setAssets(el.data);setLastUpdate(el.timestamp)}).catch(err=>console.error(err))
    },[])//se executa doar cand se monteaza componenta(prima data)
    return(
        <tbody>
            {assets&& assets.map(coin =><Item item={coin} key={coin.symbol}/>)}
            {lastUpdate&&<div>{lastUpdate}</div>}
        </tbody>
    )
}
export default AssetsList
